import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Modal from "react-modal";
import { ColourContext } from "context/colourContext";

Modal.setAppElement("#root");

ReactDOM.render(
  <ColourContext>
  <App />
  </ColourContext>,
  document.getElementById("root")
);
